import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import Footer from '../Footer';

function Payment() {
  return (
    <>
      <HeroSection />
      <h1>Payment</h1>
      <br></br>
      <p1>Question 1</p1>
      <br></br>
      <ul>
      <p2>Answer 1</p2>
      <p2>Answer 2</p2>
      <p2>Answer 3</p2>
      <p2>Answer 4</p2>
      </ul>
      <Footer />
    </>
  );
}

export default Payment;
